import React, { useState } from 'react';
import { useForm } from 'react-hook-form';
import { diagnosisService, DiagnosisRequest, DiagnosisResponse, AIBackendResponse } from '../services/diagnosisService';

const Diagnosis: React.FC = () => {
  const { register, handleSubmit, formState: { errors } } = useForm<DiagnosisRequest>();
  const [result, setResult] = useState<DiagnosisResponse | null>(null);
  const [aiResult, setAiResult] = useState<AIBackendResponse | null>(null);
  const [error, setError] = useState<string>('');
  const [loading, setLoading] = useState<boolean>(false);
  const [useAIBackend, setUseAIBackend] = useState<boolean>(false);

  const onSubmit = async (data: DiagnosisRequest) => {
    setError('');
    setLoading(true);
    setResult(null);
    setAiResult(null);

    try {
      if (useAIBackend) {
        // Gọi AI backend trực tiếp (không lưu lịch sử)
        const aiRes = await diagnosisService.getAIDiagnosis(data);
        setAiResult(aiRes);
      } else {
        // Gọi Java backend (bao gồm auth và lưu lịch sử)
        const res = await diagnosisService.performDiagnosis(data);
        setResult(res);
      }
    } catch (e: any) {
      setError(e.response?.data || e.message || 'Không thể chẩn đoán');
    } finally {
      setLoading(false);
    }
  };

  return (
    <div className="grid lg:grid-cols-2 gap-6">
      <form onSubmit={handleSubmit(onSubmit)} className="card">
        <h2 className="text-xl font-semibold mb-4">Nhập chỉ số sinh học</h2>

        {/* Toggle để chọn backend */}
        <div className="mb-4 p-3 bg-gray-50 rounded-lg">
          <div className="flex items-center space-x-4">
            <label className="flex items-center space-x-2">
              <input 
                type="radio" 
                name="backend" 
                checked={!useAIBackend}
                onChange={() => setUseAIBackend(false)}
                className="h-4 w-4"
              />
              <span className="text-sm">Java Backend (Auth + Lưu lịch sử)</span>
            </label>
            <label className="flex items-center space-x-2">
              <input 
                type="radio" 
                name="backend" 
                checked={useAIBackend}
                onChange={() => setUseAIBackend(true)}
                className="h-4 w-4"
              />
              <span className="text-sm">AI Backend (Chỉ chẩn đoán)</span>
            </label>
          </div>
          <p className="text-xs text-gray-500 mt-1">
            {useAIBackend 
              ? "Sử dụng AI backend trực tiếp, không lưu lịch sử" 
              : "Sử dụng Java backend với xác thực và lưu lịch sử"
            }
          </p>
        </div>

        {error && <div className="mb-4 p-3 bg-red-50 border border-red-200 rounded text-red-700">{error}</div>}

        <div className="form-group">
          <label className="form-label">Glucose (mg/dL) *</label>
          <input type="number" step="0.1" className="input" {...register('glucoseLevel', { required: 'Bắt buộc' })} />
          {errors.glucoseLevel && <p className="form-error">{errors.glucoseLevel.message}</p>}
        </div>

        <div className="grid grid-cols-2 gap-4">
          <div className="form-group">
            <label className="form-label">HbA1c (%)</label>
            <input type="number" step="0.1" className="input" {...register('hbA1c')} />
          </div>
          <div className="form-group">
            <label className="form-label">BMI</label>
            <input type="number" step="0.1" className="input" {...register('bmi')} />
          </div>
          <div className="form-group">
            <label className="form-label">Huyết áp tâm thu</label>
            <input type="number" className="input" {...register('systolicBP')} />
          </div>
          <div className="form-group">
            <label className="form-label">Huyết áp tâm trương</label>
            <input type="number" className="input" {...register('diastolicBP')} />
          </div>
          <div className="form-group">
            <label className="form-label">Tuổi</label>
            <input type="number" className="input" {...register('age')} />
          </div>
          <div className="form-group">
            <label className="form-label">Cân nặng (kg)</label>
            <input type="number" step="0.1" className="input" {...register('weight')} />
          </div>
          <div className="form-group">
            <label className="form-label">Chiều cao (cm)</label>
            <input type="number" step="0.1" className="input" {...register('height')} />
          </div>
          <div className="form-group flex items-center space-x-2">
            <input type="checkbox" id="familyHistory" className="h-4 w-4" {...register('familyHistory')} />
            <label htmlFor="familyHistory" className="text-sm">Tiền sử gia đình</label>
          </div>
          <div className="form-group flex items-center space-x-2">
            <input type="checkbox" id="physicalActivity" className="h-4 w-4" {...register('physicalActivity')} />
            <label htmlFor="physicalActivity" className="text-sm">Hoạt động thể chất thường xuyên</label>
          </div>
          <div className="form-group flex items-center space-x-2">
            <input type="checkbox" id="smoking" className="h-4 w-4" {...register('smoking')} />
            <label htmlFor="smoking" className="text-sm">Hút thuốc</label>
          </div>
        </div>

        <button type="submit" className="btn btn-primary" disabled={loading}>
          {loading ? 'Đang chẩn đoán...' : 'Chẩn đoán'}
        </button>
      </form>

      <div className="card">
        <h2 className="text-xl font-semibold mb-4">Kết quả</h2>
        {!result && !aiResult ? (
          <p className="text-gray-500">Chưa có kết quả. Hãy nhập chỉ số và chẩn đoán.</p>
        ) : (
          <div>
            {result && (
              <div className="mb-4 p-3 bg-blue-50 border border-blue-200 rounded">
                <h3 className="font-medium text-blue-800 mb-2">Java Backend Result:</h3>
                <p className="mb-2">
                  <span className="font-medium">Kết luận:</span> {result.diagnosisDisplayName}
                </p>
                <p className="mb-2">
                  <span className="font-medium">Điểm nguy cơ:</span> {result.riskScore}
                </p>
                <p className="whitespace-pre-line mt-4 text-gray-700">{result.recommendations}</p>
              </div>
            )}

            {aiResult && (
              <div className="mb-4 p-3 bg-green-50 border border-green-200 rounded">
                <h3 className="font-medium text-green-800 mb-2">AI Backend Result:</h3>
                <p className="mb-2">
                  <span className="font-medium">Prediction:</span> {aiResult.prediction === 1 ? 'Có nguy cơ' : 'Bình thường'}
                </p>
                <p className="mb-2">
                  <span className="font-medium">Kết luận:</span> {aiResult.diagnosisResult}
                </p>
                <p className="mb-2">
                  <span className="font-medium">Điểm nguy cơ:</span> {aiResult.riskScore}
                </p>
                <p className="whitespace-pre-line mt-4 text-gray-700">{aiResult.recommendations}</p>
              </div>
            )}
          </div>
        )}
      </div>
    </div>
  );
};

export default Diagnosis;
